    function getimageInfo($imageName = '') {
    	$imageInfo = getimagesize($imageName);
    	if ($imageInfo !== false) {
    		$new_img_info = array (
    				"name"=>basename($imageName),
    				"width"=>$imageInfo[0],
    				"height"=>$imageInfo[1],
    				"type"=>strtolower ( substr ( image_type_to_extension ( $imageInfo [2] ), 1 ) ),
    				"size"=>filesize($imageName)
    		);
    		return $new_img_info;
    	}else {
    		return false;
    	}
    }
    
    function getRange($cnt=9){
    	$numbers = range (1,$cnt);
    	//播下随机数发生器种子，可有可无，测试后对结果没有影响
    	srand ((float)microtime()*1000000);
    	shuffle ($numbers);
    	//跳过list第一个值（保存的是索引）
    	$n = '';
    	while (list(, $number) = each ($numbers)) {
    		$n .="$number";
    	}
    	return $n;
    }
    
    
    /**
     * app端调用创建资料接口
     * @cong.zhao
     * @param $file_name 视频文件名
     * @param $category  视频文件类型
     * @param $operation_id  后台操作用户id
     * @param $reponse_data  app端口sdk上传返回数据
     */
    public function actionCreateResource(){
    	$file_name=isset($_POST['file_name'])?$_POST['file_name']:'';
    	$category=isset($_POST['category'])?$_POST['category']:'1';
    	$operation_id=isset($_POST['operation_id'])?$_POST['operation_id']:'0';
    	$reponse_data = isset($_POST['reponse_data'])?$_POST['reponse_data']:'';

    	if(!$file_name ||! $file_id || !$operation_id || !$reponse_data){
    		$this->_errorData('337','参数错误');
    	}
    	
    	$resource_id = ResourceLibrary::AddResource($reponse_data, $file_name, $category, $operation_id);
    	if(!$resource_id){
    		$this->_errorData('349','保存失败');
    	}
    	
    	$this->_successData(array('resource_id'=>$resource_id));
    }
    
